import re
from django.conf import settings
from django.http import HttpResponseForbidden

class TailscaleProtectMiddleware:
    """
    - Allows all access if DEBUG=True (local development)
    - Allows public access ONLY to configured public paths (webhooks)
    - Allows access to everything else ONLY if the client comes from Tailscale (100.x.x.x)
    - Returns a friendly HTML page for 403 responses
    """

    PUBLIC_PATHS = [
        r"^/healthcheck/",
        r"^/api/efaktura/?$",
        r"^/api/efaktura/.*",
    ]


    def __init__(self, get_response):
        self.get_response = get_response

    def __call__(self, request):
        
        # 1) Allow everything in DEBUG mode (local dev)
        if settings.DEBUG:
            return self.get_response(request)
        
        # 2) Allow explicitly public webhook paths
        path = request.path
        for pattern in self.PUBLIC_PATHS:
            if re.match(pattern, path):
                return self.get_response(request)
            
        # 3) Detect Tailscale-authenticated visitor
        ts_ip = request.headers.get("Tailscale-User-Derived-IP")
        ts_user = request.headers.get("Tailscale-User-Login")

        if ts_ip or ts_user:
            # User is coming through Tailscale Tunnel or Funnel
            return self.get_response(request)

        # 4) Reject all other Internet traffic with friendly HTML page
        html_content = """
        <!DOCTYPE html>
        <html lang="en">
        <head>
            <meta charset="UTF-8">
            <title>Access Denied</title>
            <style>
                body {
                    font-family: Arial, sans-serif;
                    text-align: center;
                    padding: 50px;
                    background-color: #f9f9f9;
                }
                h1 {
                    font-size: 3em;
                    color: #e74c3c;
                }
                p {
                    font-size: 1.2em;
                    color: #555;
                }
                .icon {
                    font-size: 6em;
                    margin-bottom: 20px;
                }
                a {
                    color: #3498db;
                    text-decoration: none;
                    font-weight: bold;
                }
                a:hover {
                    text-decoration: underline;
                }
            </style>
        </head>
        <body>
            <img src="data:image/png;base64,
" width="300">
            <h1>403 Zabranjeno</h1>
            <p>Ova stranica je dostupna samo unutar Tailscale mree.</p>
            <p><a href="https://tailscale.com/download">Instaliraj Tailscale</a> za pristup ovoj stranici.</p>
        </body>
        </html>
        """
        return HttpResponseForbidden(html_content)